import './App.css';
import Logo from "./img/logo.png";
import Menu from "./img/menu-alt.png";
import SignIn from './component/SignIn';
import {Redirect} from  'react-router-dom';

function App() {

  onSubmit =() =>{
    if(userFound){
      return <Redirect to="/component/SignIn"/>
    }
  }

  return (
      <div className="Body">
        <div className="NavBar">
          <div>
            <a className="Logo" href="App.js">
              <img src={Logo} width="70" heigth="70" alt="" />
            </a>
            <a className="Titre" href = "App.js">
              <h1>Cheeky</h1>
            </a>
          </div>
          <div className="Menu">
            <ul>
              <li class="Active">
                <a href="#"><img src={Menu} alt=""/></a>
                <ul class="MenuCRS">
                  <li className="CRS">
                    <button onClick={this.onSubmit}>
                      SignIn
                    </button>
                  </li>
                  <li className="CRS">
                    <a href="Contact.js">
                      Contact
                    </a>
                  </li>
                </ul>
              </li>
            </ul>
          </div>
        </div>
      </div>
  );
}



export default App;
